	static void crossNormals(double x, double y, double z)
	{
		Vector d = new Vector();
		d.x = x;
		d.y = y;
		d.z = z;
		List<connections> connecting = new ArrayList<connections>();
		for(int i = 0; i < settingUpMap.mapData.size(); i ++)
		{
			Data j = settingUpMap.mapData.get(i);
			if(j.v1.x == d.x && j.v1.y == d.y && j.v1.z == d.z)
			{
				connections c = new connections();
				c.connectNum1 = i;
				c.pointConnect1 = 1;
				c.normal = j.v1Normal;
				connecting.add(c);
			}
			else if(j.v2.x == d.x && j.v2.y == d.y && j.v2.z == d.z)
			{
				connections c = new connections();
				c.connectNum1 = i;
				c.pointConnect1 = 2;
				c.normal = j.v2Normal;
				connecting.add(c);
			}
			else if(j.v3.x == d.x && j.v3.y == d.y && j.v3.z == d.z)
			{
				connections c = new connections();
				c.connectNum1 = i;
				c.pointConnect1 = 3;
				c.normal = j.v3Normal;
				connecting.add(c);
			}
		}
		
			
				
		
		Vector overAllNormal = new Vector();
		for(int i = 0; i < connecting.size(); i ++)
		{
			connections c = connecting.get(i);
			overAllNormal = overAllNormal.add(c.normal);
		}
		overAllNormal = overAllNormal.normalize();
		for(int i = 0; i < connecting.size(); i ++)
		{
			connections c = connecting.get(i);
			Data m = settingUpMap.mapData.get(c.connectNum1);
			if(c.pointConnect1 == 1)
			{
				m.v1Normal = overAllNormal;
			}
			else if(c.pointConnect1 == 2)
			{
				m.v2Normal = overAllNormal;
			}
			else if(c.pointConnect1 == 3)
			{
				m.v3Normal = overAllNormal;
			}
		}
	}
