	static Vector getSurfaceNormal(Data d)
	{
			Vector v1 = d.v2.subtract( d.v1);
			Vector v2 = d.v3.subtract(d.v1);
			Vector normal = v1.crossProduct(v2);
			normal = normal.normalize();
			return normal;
	}
	
